import './Dashboard.css'
import React, { useState } from 'react'
import {
  Link,
  useNavigate,
  useLocation,
  Navigate,
  useParams,
} from 'react-router-dom'
import { Dialog } from '@mui/material'
const Note = ({ note, Outlet }) => {
  const location = useLocation()
  const { id } = useParams()
  const navigate = useNavigate()
 
 
  return (
    // <div className='note-container' onClick={(e) => onNoteClick(_id)}>
    <div >
      
      
        <h4>Use useEffect in Note.js coasmponent</h4>
        Displaying the id : {id}
    </div>
  )
}

export default Note
